// 获取url？后面的参数
function GetRequest() {
    var url = location.search; //获取url中"?"符后的字串
    var theRequest = new Object();
    if (url.indexOf("?") != -1) {
        var str = url.substr(1);
        strs = str.split("&");
        for (var i = 0; i < strs.length; i++) {
            theRequest[strs[i].split("=")[0]] = unescape(strs[i].split("=")[1]);
        }
    }
    return theRequest;
}
if(GetRequest().Operate!='yes'&&$('html').width()>=992&&(window.location+'').indexOf('qcdq_m')==-1){
    window.location=window.location.href.replace("ct_m","ct_pc");
}
$(function () {
    if($('.M_content').height()<=2499){
        $('.M_book').hide()
    }
    var public_url='http://op.chitunion.com'
    // 计算腰部高度
    if($('.M_Waist img').attr('mimg')==1){
        //    图片宽度
        var img_w=$('.M_Waist img').width();
        $('.M_Waist img').each(function () {
            $(this).css('height',(img_w * 2 / 3)+'px')
            $(this).next().css('height',(img_w * 2 / 3)+'px')
        })
    }
    // 查看全部
    $('.M_book').off('click').on('click',function () {
        $(this).css('display','none');
        $('.M_content').css('max-height','100%')
    })
    // 关闭底部
    $('footer p img').off('click').on('click',function () {
        $('footer').hide()
    });

    //绑定百度统计trackEvent事件逻辑
    $('[baidu_track_name][baidu_track_action]').off('click').on('click', function () {
        var name = $(this).attr('baidu_track_name');
        var action = $(this).attr('baidu_track_action');
        var label = $(this).attr('baidu_track_label');
        var val = $(this).attr('baidu_track_val');
        if (val == null) {
            window._hmt && window._hmt.push(['_trackEvent', name, action, label == null ? '-' : label]);
        }
        else {
            window._hmt && window._hmt.push(['_trackEvent', name, action, label == null ? '-' : label, val]);
        }
    });


    $.ajax({
        url:public_url+'/api/ApiNL/GetLikeCount',
        type:'get',
        dataType: 'json',
        data:{
            MaterieUrl:window.location.href
        },
        xhrFields: {
            withCredentials: true
        },
        crossDomain: true,
        success: function (data) {
            if(data.Status==0){
                // 点赞渲染
                $('.M_Fabulous_img div').eq(0).find('span').text(data.Result.LikeCount)
                $('.M_Fabulous_img div').eq(1).find('span').text(data.Result.NoLikeCount)
                // 点赞功能
                if (data.Result.ClickType == 1) {
                    $('.M_Fabulous .M_Fabulous_img div').eq(0).css('background-image','url(data:image/png;base64,)');
                }else if(data.Result.ClickType == 2){
                    $('.M_Fabulous .M_Fabulous_img div').eq(1).css('background-image','url(data:image/png;base64,)');
                }
                var judge=true;
                if(data.Result.ClickType != 0){
                    judge=false;
                }
                $('.M_Fabulous .M_Fabulous_img div').off('click').on('click',function () {
                    if(judge){
                        if ($(this).find('span').attr('i')==1){
                            if(M_operation($(this).find('span').attr('i'))){
                            var getnub=$(this).find('span').html()-0+1;
                            $(this).find('span').html(getnub);
                            $(this).css('background-image','url(data:image/png;base64,)');
                            }
                        }else {
                            if (M_operation($(this).find('span').attr('i'))) {
                            var getnub = $(this).find('span').html() - 0 + 1;
                            $(this).find('span').html(getnub);
                            $(this).css('background-image', 'url(data:image/png;base64,)');
                        }
                        };
                        judge=false;
                    }
                })
            }else {
                //alert(data.Message)
            }
        }

    })
    // 物料静态页点赞点踩接口
    function M_operation(i) {
        var that=true;
        $.ajax({
            url:public_url+'/api/ApiNL/SetCustomerInfo',
            type:'post',
            asycn:false,
            dataType: 'json',
            data:{
                MaterieUrl:window.location.href,
                LikeType:i
            },
            xhrFields: {
                withCredentials: true
            },
            crossDomain: true,
            success: function (data) {
                if(data.Status==0){

                }else {
                    alert(data.Message);
                    that=false
                }
            }
        });
        return that
    }

    // 控制M_content下的标签
    $('.M_content img').css('max-width','100%');
})